import React, { Component } from 'react'
import Navbar from "../components/Navbar"
import Container from "../components/HomeContainer"
import EmailForm from "../components/Email"
import Footer from "../components/Footer"
import HomeContainer from '../components/HomeContainer'

class Home extends Component {
    constructor(props) {
        super(props)
        this.state = {
            email: true,
            whichComponentToShow: 'Home'
        }
    }

    emailForm = () => {
            this.setState({
                whichComponentToShow: "Email"
        })
        // else {
        //     this.setState({
        //         email: true,
        //         home:false
        //     })
        // }
    }
    homeContents = () => {
            this.setState({
                whichComponentToShow: "Home"
            })

    }


    render() {
        if(this.state.whichComponentToShow === 'Home'){
            return(
                <div>
                    <HomeContainer/>
                </div>
            )
        }else if (this.state.whichComponentToShow === 'Email'){
            return (
                <div>
                    <EmailForm/>
                </div>
            )
        }else if (this.state.whichComponentToShow === 'Machine'){
            return (

                <div>
                    <Container/>
                </div>
            )
        }

        return (
            <div>
                <Navbar changeComponent={this.whichComponentToShow} homeContents={this.homeContents}>
                </Navbar >


                {(this.state.email) ? <Container /> : <EmailForm />}




                <Footer>
                </Footer>
            </div>
        )
    }
}
export default Home;
